import React, { useState } from "react";
import { Link } from "react-router-dom";
// import axios from "axios";
// import { useNavigate } from "react-router-dom";

const Index = () => {
  return (
    <div>
      <div className="containerChatlist">
        <div className="row">
          <div className="col-md-3 bg-danger">
            <div className="row">
              <div className="col-md-10">
                <h5>Telegram</h5>
              </div>
              <div className="col-md-1">
                <i className="fa fa-align-right"></i>
              </div>
            </div>
            <div className="row">
                <div className="col-md-10">
                    <div className="input-group rounded-pill px-4">
                    <button id="button-addon3" type="button" className="btn btn-link text-success"><i className="fa fa-search"></i></button>
                        <input type="search" placeholder="Search" aria-describedby="button-addon3" className="form-control bg-none border-0" />
                        <div className="input-group-append border-0">
                            <button id="button-addon3" type="button" className="btn btn-link text-success"><i className="fa fa-search"></i></button>
                        </div>
                    </div>
                </div>
                <div className="col-md-1">
                    <i className="fa fa-plus"></i>
                </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Index;
